  Data.find().then(data => {
    res.json(data);
  }).catch(error => {
    console.error(error);
    res.status(500).json({ message: 'Error fetching data' });
  });
});

app.post('/api/data', (req, res) => {
  const data = new Data(req.body);
  data.save().then(() => {
    res.json(data);
  }).catch(error => {
    console.error(error);
    res.status(500).json({ message: 'Error creating data' });
  });
});

app.listen(3001, () => {
  console.log('Server listening on port 3001');
});
